import React, { createContext, useState } from 'react'

export const AuthenticatedUser = createContext();

const AuthenticatedUserProvider = (props) => {
    const [authUser, setAuthUser] = useState({ authUser: 'test' })
    const setAuthenticatedUser = (authdUser) => {
        setAuthUser({ authUser })
    }
    return (
        <AuthenticatedUser.Provider value={{ authUser, setAuthenticatedUser:()=>{setAuthenticatedUser} }}>
            {props.children}
        </AuthenticatedUser.Provider>
    );
}

export default AuthenticatedUserProvider;
